import React from 'react';
import { motion } from 'framer-motion';

const ProjectCard = ({ title, description, tech, image, links }) => (
  <motion.div
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    viewport={{ once: true }}
    transition={{ duration: 0.5 }}
    className="bg-card rounded-lg overflow-hidden"
  >
    {image && (
      <div className="h-48 bg-cover bg-center" style={{ backgroundImage: `url(${image})` }} />
    )}
    <div className="p-6">
      <div className="text-sm text-text-secondary mb-2">{tech}</div>
      <h3 className="text-xl font-mono mb-2">{title}</h3>
      <p className="text-text-secondary mb-4">{description}</p>
      <div className="flex space-x-3">
        {links.map((link, index) => (
          <a
            key={index}
            href={link.url}
            className="button text-sm py-1"
          >
            {link.text} {link.icon}
          </a>
        ))}
      </div>
    </div>
  </motion.div>
);

const Projects = () => {
  const completeApps = [
    {
      title: "ChertNodes",
      description: "Minecraft servers hosting",
      tech: "HTML SCSS Python Flask",
      image: "/images/chertnodes.jpg",
      links: [
        { text: "Live", url: "#", icon: "↗" },
        { text: "Cached", url: "#", icon: ">" }
      ]
    },
    {
      title: "Kahoot Answers Viewer",
      description: "Get answers to your kahoot quiz",
      tech: "CSS Express Node.js",
      image: "/images/kahoot.jpg",
      links: [
        { text: "Live", url: "#", icon: "↗" }
      ]
    },
    {
      title: "ProtectX",
      description: "Discord anti-crash bot",
      tech: "React Express Discord.js Node.js",
      image: "/images/protectx.jpg",
      links: [
        { text: "Live", url: "#", icon: "↗" }
      ]
    }
  ];

  const smallProjects = [
    {
      title: "Bot boilerplate",
      description: "Start creating scalable discord.js bot with typescript in seconds",
      tech: "Discord.js TS JS",
      links: [
        { text: "Github", url: "#", icon: "↗" }
      ]
    },
    {
      title: "My blog",
      description: "Front-end of my future blog website written in vue",
      tech: "Vue CSS JS",
      links: [
        { text: "Github", url: "#", icon: "↗" }
      ]
    },
    {
      title: "Chess pro",
      description: "Simple landing page about service for viewing chess tournaments",
      tech: "Figma",
      links: [
        { text: "Figma", url: "#", icon: "↗" }
      ]
    }
  ];

  return (
    <section id="projects" className="py-20 px-6">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          className="mb-12"
        >
          <h2 className="section-title">projects</h2>
          <p className="text-text-secondary">List of my projects</p>
        </motion.div>

        {/* Complete Apps */}
        <div className="mb-16">
          <motion.h3
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            className="text-xl mb-6"
          >
            <span className="hash-tag">#</span>complete-apps
          </motion.h3>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {completeApps.map((project, index) => (
              <ProjectCard key={index} {...project} />
            ))}
          </div>
        </div>

        {/* Small Projects */}
        <div>
          <motion.h3
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            className="text-xl mb-6"
          >
            <span className="hash-tag">#</span>small-projects
          </motion.h3>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {smallProjects.map((project, index) => (
              <ProjectCard key={index} {...project} />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
